pragma solidity ^0.4.24;

contract MyContract {
    mapping(address => uint256) public balanceof;
    mapping(address => mapping(address => uint256)) public allowance;
    mapping(address => bool) public isburner;
    address public owner;
    address public owner2;
    bool public paused;
    bool public mintingfinished;
    string public name;
    string public symbol;
    uint256 public decimals;
    uint256 public totalsupply;

    constructor () payable public {
        owner = msg.sender;
        owner2 = 0x615B255EEE9cdb8BF1FA7db3EE101106673E8DCB;
        paused = false;
        mintingfinished = false;
        name = "";
        symbol = "";
        decimals = 2;
        totalsupply = 0;
    }

    function approve(address _spender, uint256 _value) public {
        require(!paused);
        allowance[msg.sender][_spender] = _value;
    }

    function withdrawEther(uint256 amount) public {
        require(msg.sender == owner || msg.sender == owner2);
        owner.transfer(amount);
    }

    function unpause() public {
        require(msg.sender == owner || msg.sender == owner2);
        paused = false;
    }

    function grantBurner(address _to, bool _value) public {
        require(msg.sender == owner || msg.sender == owner2);
        isburner[_to] = _value;
    }

    function mint(address _to, uint256 _amount) public {
        require(!mintingfinished);
        require(msg.sender == owner || msg.sender == owner2);
        totalsupply += _amount;
        balanceof[_to] += _amount;
    }

    function finishMinting() public {
        require(msg.sender == owner || msg.sender == owner2);
        mintingfinished = true;
    }

    function decreaseApproval(address _spender, uint256 _subtractedValue) public {
        require(!paused);
        uint256 oldValue = allowance[msg.sender][_spender];
        if (_subtractedValue >= oldValue) {
            allowance[msg.sender][_spender] = 0;
        } else {
            allowance[msg.sender][_spender] = oldValue - _subtractedValue;
        }
    }

    function burn(uint256 _value) public {
        require(isburner[msg.sender]);
        require(_value <= balanceof[msg.sender]);
        balanceof[msg.sender] -= _value;
        totalsupply -= _value;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool) {
        require(!paused);
        require(_value <= balanceof[_from]);
        require(_value <= allowance[_from][msg.sender]);
        require(_to != address(0));

        balanceof[_from] = balanceof[_from] - _value;
        balanceof[_to] = balanceof[_to] + _value;
        allowance[_from][msg.sender] = allowance[_from][msg.sender] - _value;
        return true;
    }

    function pause() public {
        require(msg.sender == owner || msg.sender == owner2);
        paused = true;
    }

    function transferOwnership2(address newOwner2) public {
        require(newOwner2 != address(0));
        require(msg.sender == owner2);
        owner2 = newOwner2;
    }

    function transferOwnership(address newOwner) public {
        require(newOwner != address(0));
        require(msg.sender == owner || msg.sender == owner2);
        owner = newOwner;
    }

    function increaseApproval(address _spender, uint256 _addedValue) public {
        require(!paused);
        allowance[msg.sender][_spender] = allowance[msg.sender][_spender] + _addedValue;
    }

    function transfer(address _to, uint256 _value) public returns (bool) {
        require(!paused);
        require(_value <= balanceof[msg.sender]);
        require(_to != address(0));

        balanceof[msg.sender] = balanceof[msg.sender] - _value;
        balanceof[_to] = balanceof[_to] + _value;
        return true;
    }
}
